import React from "react";

function CoinComponent({ coin, index }) {
  console.log(coin);

  return <tr className="coin_component" key={index}>
      {coin.name}
      <th>Coin</th>
    <th>Price</th>
    <th>Change</th>
    <th>24hVolume</th>
    <th>Rank</th>
  </tr>;
}

export default CoinComponent;
